INSERT INTO `suroviny` VALUES (2,'Acai bobule','','Ovoce bohů',1,'palma Acai v pralesech','Brazílie','','','','acai.jpg','nejsilnější přírodní antioxidant,  urychluje metabolismus, snižuje cholesterol, napomáhá optimalizaci tělesných funkcí, podporuje pocit svěžesti a tlumí chuť k jídlu','');
INSERT INTO `suroviny` VALUES (3,'Aloe Vera','','',0,'sukulentní rostlina','severní Afrika','','','','alor.vera.jpg','antibakteriální, antivirové, s pozitivním působením na svaly a klouby, zlepšuje krevní tlak, pomáhá při překyselení žaludku a pálení žáhy, prevence nádorových onemocnění, doplněk stravy, antihistamické vlastnosti (popálení, opary, alergické reakce)','');
INSERT INTO `suroviny` VALUES (4,'Šalvěj Hispánská','','Chia semínka',0,'','jižní Amerika','','','','chia.jpg','','0101');
INSERT INTO `suroviny` VALUES (5,'Chlorella','','',0,'Jednobuněčná sladkovodní řasa','','','','','','Představuje jeden z nejbohatších zdrojů vitamínů, minerálů a dalších vzácných látek. Obsahuje přírodní antibiotikum jež dokáže zastavit či potlačit řadu infekcí včetně boreliózy. Podporuje trávení, oslabuje chronickou únavu a pozitivně ovlivňuje spánek, myšlení a paměť.','');
INSERT INTO `suroviny` VALUES (6,'Kustovnice čínská','','Goji (čínské tajemství dlouhověkosti)',0,'','','','','','','Obsahuje 18 druhů aminokyselin, 21 stopových prvků a jsou nejbohatším zdrojem karotenoidů ze všech známých rostlin na zemi. Silný antioxidant předchází předčasnému stárnutí, podporuje vitalitu a sexuální potenci. Působí jako afrodiziakum.','');
INSERT INTO `suroviny` VALUES (7,'Maca kořen','','',0,'kořen připomínající řepu','Peru','','','','maca.jpg','působí na zvýšení fyzické odolnosti, vytrvalosti a optimalizování hormonální hladiny. Způsobuje nárůst síly a svalové hmoty, posiluje imunitu a pomáhá při léčbě osteoporózy, chudokrevnosti i rakoviny.','');
INSERT INTO `suroviny` VALUES (8,'Zelený ječmen','','',0,'Extrakt z listů mladého ječmene','','','','','jecmen.jpg','má vysokou výživovou hodnotu spojenou s velkými detoxikačními účinky. Snižuje překyselení organismu, tělesné pachy a riziko rakoviny. Dlouhodobě zlepšuje psychiku, normalizuje hladinu cukrů v krvi a působí příznivě na peristaltiku střev.','');
INSERT INTO `suroviny` VALUES (9,'Jackfruit','','',1,'roste na chlebovníku, vážící až 20 kg','Malajsie','vůně po svěžích banánech a mangu','chuť po svěžích banánech a mangu','slupka obsahuje přírodní latex','jackfruit.jpg','','');
