INSERT INTO `n53_citat` VALUES (1,'Morihei Ueshiba','cz','jp',NULL,'Máte-li v sobě život, jsou vám přístupny všechny pravdy a tajemství, protože pravda vesmíru je obsažena v každém lidském jedinci.');
INSERT INTO `n53_citat` VALUES (2,'Vlasta Burian','cz','cz',NULL,'Žena se dívá do prázdna jen tehdy, nemá-li zrcadlo.');
INSERT INTO `n53_citat` VALUES (3,'Vlasta Burian','cz','cz',NULL,'Humor není pro mne odvětvím divadelního umění, nýbrž samou podstatou života.');
INSERT INTO `n53_citat` VALUES (4,'Vlasta Burian','cz','cz',NULL,'Nejkrásnější život v době tolika vyhlášek mají analfabeti.');
INSERT INTO `n53_citat` VALUES (5,'Vlasta Burian','cz','cz',NULL,'Pravda je jen jedna. Proto ji nemůžeme mít každý.');
INSERT INTO `n53_citat` VALUES (6,'Vlasta Burian','cz','cz',NULL,'Muži dělají za řečí tečku, ženy dvojtečku.');
INSERT INTO `n53_citat` VALUES (7,'Albert Einstein','cz','en',NULL,'Inteligentní lidé se snaží problémy řešit, geniální se je snaží nedělat.');
INSERT INTO `n53_citat` VALUES (8,'Albert Einstein','cz','en',NULL,'Pouze dvě věci jsou nekonečné. Vesmír a lidská hloupost. U té první si nejsem tak zcela jist.');
INSERT INTO `n53_citat` VALUES (9,'Albert Einstein','cz','en',NULL,'Žádné množství pokusů nikdy nemůže dokázat, že jsem měl pravdu. Jediný však kdykoliv může dokázat, že jsem se mýlil.');
INSERT INTO `n53_citat` VALUES (10,'Albert Einstein','cz','en',NULL,'Je to ale smutné období, když je snadnější rozbít atom než zničit předsudky.');
INSERT INTO `n53_citat` VALUES (11,'Albert Einstein','cz','en',NULL,'Je-li nepořádek na stole odrazem nepořádku v mysli, co potom odráží prázdný stůl? ');
INSERT INTO `n53_citat` VALUES (12,'Albert Einstein','cz','en',NULL,'Nevím, čím se bude bojovat ve třetí světové válce, ale v té čtvrté to budou klacky a kameny.');
INSERT INTO `n53_citat` VALUES (13,'Albert Einstein','cz','en',NULL,'Existují tisíce způsobů, jak zabít čas, ale žádný jak ho vzkřísit.');
INSERT INTO `n53_citat` VALUES (14,'Albert Einstein','cz','en',NULL,'Vědět málo je nebezpečné a vědět mnoho také.');
